public ActionForward perform_back_action(ActionMapping mapping, ActionForm form, HttpServletRequest request, HttpServletResponse response) {
  HttpSession session = request.getSession(true);
  ActionForward actionForward = null;
  try {
    RelatorioApontamentoCaixas_rActionForm f = (RelatorioApontamentoCaixas_rActionForm) form;
    actionForward = new ActionForward("/com/RelatorioApontamentoCaixasForm.jsp", false);
  } catch (Exception e) {
    ActionErrors errors = new ActionErrors();
    errors.add("ActionErrors.GLOBAL_ERROR_bl_form_Jw_apontamento_caixas_corrugadas", new ActionMessage("error.action.exception",com.egen.util.system.Error.getMessage(e)));
